import React from "react";
import "../style/header.css";
import MenuPopOut from "./MenuPopOut.js";

import SignInForm from "./SignInForm.js";
import SignUpForm from "./SignUpForm.js";

function Header({ backHome, setAuth, resetAuth }) {
  const [popOutClicked, setPopOutClicked] = React.useState(false);
  const [login, setterLogin] = React.useState(false);
  const [signin, setterSignin] = React.useState(false);

  const setPopOut = () => {
    setPopOutClicked(true);
  };

  const resetPopOut = () => {
    setPopOutClicked(false);
  };

  const setLogin = (e) => {
    e.preventDefault(); // Prevent page refresh
    if (!login) {
      setterLogin(true);
      setAuth();
      setterSignin(false);
    }
  };

  const resetLogin = () => {
    setterLogin(false);
    resetAuth();
  };

  const setSignUp = () => {
    setterSignin(true);
    setterLogin(false);
    setAuth();
  };

  const resetSignUp = () => {
    setterSignin(false);
    resetAuth();
  };

  const returnBack = () => {
    backHome();
    resetLogin();
    resetSignUp();
  };

  return (
    <div>
      {login && <SignInForm resetLogin={resetLogin} />}
      {signin && <SignUpForm resetSignup={resetSignUp} />}
      {popOutClicked && (
        <MenuPopOut
          resetPopOut={resetPopOut}
          login={login}
          signin={signin}
          setLogin={setLogin}
          resetLogin={resetLogin}
          setSignup={setSignUp}
          resetSignUp={resetSignUp}
        />
      )}
      <div className="Header">
        <div className="HeaderLeft">
          <div className="headerMenu" onClick={setPopOut}></div>
          <div className="headerTitle" onClick={returnBack}>
            Fix-It
          </div>
        </div>

        <div className="HeaderRight">
          {/* Correcting onClick to pass the event to setLogin */}
          <div className="headerLogin" onClick={(e) => setLogin(e)}>
          </div>
          <div className="headerSignUp" onClick={setSignUp}>
            SignUp
          </div>
        </div>
      </div>
    </div>
  );
}

export default Header;
